cy.request({
  method: "POST",
  url: baseUrl + "//orders",
  headers: {
    Authorization: "Bearer " + tokenValue
  },
  body: {
    "bookId": newOrderId,
    "customerName": newOrderName
  }
}).then((res) => {
  expect(res.status).to.eq(201);
  expect(res.body).to.not.empty;
  orderIdValue = res.body.orderId;
  cy.log("Current Order Id", orderIdValue);
});

